INSERT INTO `equipment` (`equipment_id`, `name`, `usage_instructions`, `image_id`) VALUES
(1, 'Chef\'s Knife', 'Use for chopping, slicing, and dicing ingredients. Hold the handle firmly and use a rocking motion for cutting.', 4),
(2, 'Cutting Board', 'Place ingredients on the cutting board for chopping, slicing, and other prep work. Use a damp cloth to clean after use.', NULL),
(3, 'Frying Pan', 'Use for frying, sautéing, and searing ingredients. Heat oil or butter in the pan before adding ingredients.', NULL),
(4, 'Saucepan', 'Use for heating sauces, soups, and other liquids. Choose a size appropriate for the amount of liquid being heated.', NULL),
(5, 'Mixing Bowl', 'Use for mixing ingredients together. Choose a size appropriate for the quantity of ingredients being mixed.', NULL),
(6, 'Whisk', 'Use for whisking together ingredients such as eggs, sauces, and dressings. Hold the handle firmly and move in a circular motion.', NULL),
(7, 'Spatula', 'Use for flipping and lifting ingredients such as pancakes, omelets, and cookies. Slide the spatula under the ingredients and lift gently.', NULL),
(8, 'Measuring Cups and Spoons', 'Use for accurately measuring ingredients such as flour, sugar, and spices. Use level measurements for dry ingredients and fill to the brim for liquids.', NULL),
(9, 'Baking Sheet', 'Use for baking cookies, pastries, and other baked goods. Place parchment paper or silicone mats on the sheet to prevent sticking.', NULL),
(10, 'Mixing Spoon', 'Use for stirring and mixing ingredients in pots, pans, and bowls. Choose a spoon appropriate for the size of the container.', NULL),
(11, 'Rolling Pin', 'Use for rolling out dough for pies, pastries, and other baked goods. Apply even pressure while rolling to achieve an even thickness.', NULL),
(12, 'Strainer', 'Use for draining liquids from ingredients such as pasta, vegetables, and canned goods. Hold over the sink or a bowl while pouring.', NULL),
(13, 'Colander', 'Use for rinsing and draining ingredients such as fruits, vegetables, and grains. Shake gently to remove excess water after rinsing.', NULL),
(14, 'Oven Mitts', 'Use for safely handling hot dishes and pans from the oven. Ensure a secure grip on the dish or pan while wearing mitts.', NULL),
(15, 'Tongs', 'Use for grasping and lifting ingredients such as meat, vegetables, and pasta. Squeeze the tongs to grip the ingredients securely.', NULL),
(16, 'Grater', 'Use for grating ingredients such as cheese, vegetables, and citrus zest. Hold the grater firmly and move ingredients in a downward motion.', NULL),
(17, 'Blender', 'Use for blending ingredients to make smoothies, soups, sauces, and purees. Place ingredients in the blender jar and secure the lid before blending.', NULL),
(18, 'Food Processor', 'Use for chopping, slicing, grating, and pureeing ingredients. Place ingredients in the processor bowl and secure the lid before processing.', NULL),
(19, 'Stand Mixer', 'Use for mixing and kneading dough, batter, and other ingredients. Attach the appropriate mixing attachment and adjust the speed as needed.', NULL),
(20, 'Immersion Blender', 'Use for blending ingredients directly in pots, bowls, and cups. Immerse the blender head into the ingredients and blend to desired consistency.', NULL),
(21, 'Slow Cooker', 'Use for cooking soups, stews, and braises over a longer period of time. Place ingredients in the slow cooker pot and set to desired temperature and cooking time.', NULL),
(22, 'Rice Cooker', 'Use for cooking rice and grains. Add rice and water to the cooker pot, close the lid, and select the appropriate setting for the type of rice being cooked.', NULL),
(23, 'Grill Pan', 'Use for grilling meats, vegetables, and sandwiches indoors. Heat the grill pan over medium-high heat before adding ingredients.', NULL),
(24, 'Pizza Stone', 'Use for baking pizzas and breads with a crispy crust. Preheat the pizza stone in the oven before placing the pizza or bread dough on top.', NULL),
(25, 'Mortar and Pestle', 'Use for grinding and crushing spices, herbs, and other ingredients. Place ingredients in the mortar and use the pestle to crush and grind.', NULL),
(26, 'Pastry Brush', 'Use for brushing sauces, glazes, and melted butter onto baked goods. Dip the brush into the liquid and apply evenly onto the surface.', NULL),
(27, 'Cookie Cutters', 'Use for cutting dough into various shapes for cookies, pastries, and decorations. Press the cookie cutter firmly into the dough and lift to release the shape.', NULL),
(28, 'Cake Stand', 'Use for displaying and serving cakes and other baked goods. Place the cake on the stand and use a cake server to slice and serve.', NULL),
(29, 'Pastry Bag', 'Use for piping frosting, icing, and fillings onto cakes, cupcakes, and pastries. Fill the pastry bag with the desired filling and squeeze gently to pipe.', NULL),
(30, 'Cheese Grater', 'Use for grating cheese into fine or coarse shreds. Hold the grater firmly and move the cheese against the grating surface.', NULL),
(31, 'Steamer Basket', 'Use for steaming vegetables, seafood, and dumplings. Place ingredients in the basket and set over boiling water to steam.', NULL),
(32, 'Wok', 'Use for stir-frying meats, vegetables, and noodles. Heat oil in the wok and toss ingredients using a spatula or wok shovel.', NULL),
(33, 'Basting Brush', 'Use for applying marinades, sauces, and glazes onto meats, poultry, and seafood during cooking. Dip the brush into the liquid and apply evenly onto the surface.', NULL),
(34, 'Meat Thermometer', 'Use for checking the internal temperature of meats, poultry, and fish to ensure proper cooking. Insert the thermometer probe into the thickest part of the meat without touching bone or fat.', NULL),
(35, 'Pasta Maker', 'Use for rolling and cutting pasta dough into various shapes for making homemade pasta. Feed the dough through the pasta maker rollers and cut into desired shapes using the attachments.', NULL);
